import './App.css';
import { useState, useEffect } from 'react';

function App() {

  const [messages,setMessages] = useState([]);
  useEffect(() => {
    fetch('/enpo')
    .then((res) => res.json())
    .then((data) => setMessages(data));
  },[]);

  return (
    <div className="App">
      <h1>Front End</h1>
      <div>{messages.map((message)=>{
          <p>{messages}</p>
      })}</div>
    </div>
  );
}

export default App;
